const QuoteDetail = () => {
  const params = useParams();
  return (
    <Fragment>
      <h1>Quote Detail Page</h1>
      <p>{params.quoteId}</p>
      <Route path="/quotes/:quoteId/comments">
          <Comments></Comments>
      </Route>
    </Fragment>
  );
};

export default QuoteDetail;
